AD_COLUMN.SQLLOGIC:
(coalesce((select case when sum(abs(ol.qtyordered)) = 0 then 0 else 
round(coalesce(sum(abs(ol.em_ssa_qtyreturned)), 0)/sum(abs(ol.qtyordered)) * 100, 0)  end 
from c_orderline ol   where ol.c_order_id=c_order_id), 0))

(coalesce((select case when sum(abs(ol.movementqty)) = 0 then 0 else 
round(coalesce(sum(abs(ol.em_ssa_qtyreturned)), 0)/sum(abs(ol.movementqty)) * 100, 0)  end 
from m_inoutline ol   where ol.m_inout_id=m_inout_id), 0))
